import React, { Component } from "react";
import ReactDOM from "react-dom";
import data from "./data.svg";
import settings from "./settings.svg";
import stack from "./stack.svg";

class ChangeInput extends Component {
    handleEvent = event => {
      alert("I was clicked");
    };

    render() {
        return (
            <div id='Icon-wrapper'>
            <img src={data} className="Icon-data" alt="data"/>
            <img src={settings} className="Icon-settings" alt="settings"/> 
            <img src={stack} className="Icon-stack" alt="stack"/>       
            </div>
        );
    };

};
export default ChangeInput;
